import React, { useEffect, useRef, useState } from "react";
import "../src/css/ff.css";
import axios from "axios";
import "../src/css/pay.css";
import { Link, useNavigate } from "react-router-dom";
function FF({ fs1, fs2, fsd }) {
  const [jstate, setjstate] = useState();
  const [pamount, setpamount] = useState();
  const [gtype, setgtype] = useState();
  const [jsbn1, setjsbn1] = useState(false);
  const [jsbn2, setjsbn2] = useState(false);
  const [jsdbn, setjsdbn] = useState(false);
  const [pstatus, setpstatus] = useState();
  const gname = useRef(null);
  const [fsc1, setfsc1] = useState();
  const [fsc2, setfsc2] = useState();
  const [fsdc, setfsdc] = useState();
  const [joined, setjoined] = useState();
  const [ps1, setps1] = useState(false);
  const [ps2, setps2] = useState(false);
  const [psd, setpsd] = useState(false);
  const navigate = useNavigate();
  useEffect(() => {
    const fjstatus = async () => {
      const un = sessionStorage.getItem("un");
      await axios
        .post("http://localhost:4000/fjstatus", {
          username: un,
        })
        .then((res) => {
          if (res.data.count[0] < 50) {
            setfsc1(res.data.count[0]);
          } else {
            setjsbn1(true);
            setfsc1(res.data.count[0]);
            setjoined("MATCH FULL");
          }
          if (res.data.count[1] < 50) {
            setfsc2(res.data.count[1]);
          } else {
            setjsbn2(true);
            setfsc2(res.data.count[1]);
            setjoined("MATCH FULL");
          }
          if (res.data.count[2] < 50) {
            setfsdc(res.data.count[2]);
          } else {
            setjsdbn(true);
            setfsdc(res.data.count[2]);
            setjoined("MATCH FULL");
          }
          if (res.data.fsolo1 === "av") {
            setjsbn1(true);
            setjoined("JOINED");
          }
          if (res.data.fsolo2 === "av") {
            setjsbn2(true);
            setjoined("JOINED");
          }
          if (res.data.fsquad === "av") {
            setjsdbn(true);
            setjoined("JOINED");
          }
        });
    };
    fjstatus();
  }, []);
  const pc = () => {
    setjstate(false);
  };
  const pay = async () => {
    if (gtype === "fsolo1") {
      if (gname.current.value !== "") {
        const un = sessionStorage.getItem("un");
        await axios
          .post("http://localhost:4000/fsolo1", {
            username: un,
            gamename: gname.current.value,
          })
          .then((res) => {
            if (res.data.ws === "success") {
              window.location.reload(false);
              navigate("/ff");
            } else {
              setpstatus("LOW FUND RECHARGE YOUR WALLET");
            }
          });
      } else {
        setpstatus("FIELD IS EMPTY");
      }
    }
    if (gtype === "fsolo2") {
      if (gname.current.value !== "") {
        const un = sessionStorage.getItem("un");
        await axios
          .post("http://localhost:4000/fsolo2", {
            username: un,
            gamename: gname.current.value,
          })
          .then((res) => {
            if (res.data.ws === "success") {
              window.location.reload(false);
              navigate("/ff");
            } else {
              setpstatus("LOW FUND RECHARGE YOUR WALLET");
            }
          });
      } else {
        setpstatus("FIELD IS EMPTY");
      }
    }
    if (gtype === "fsquad") {
      if (gname.current.value !== "") {
        const un = sessionStorage.getItem("un");
        await axios
          .post("http://localhost:4000/fsquad", {
            username: un,
            gamename: gname.current.value,
          })
          .then((res) => {
            if (res.data.ws === "success") {
              window.location.reload(false);
              navigate("/ff");
            } else {
              setpstatus("LOW FUND RECHARGE YOUR WALLET");
            }
          });
      } else {
        setpstatus("FIELD IS EMPTY");
      }
    }
  };
  const fsolo1 = async () => {
    setpamount("20");
    setjstate(true);
    setgtype("fsolo1");
  };
  const fsolo2 = async () => {
    setpamount("20");
    setjstate(true);
    setgtype("fsolo2");
  };
  const fsquad = async () => {
    setpamount("20");
    setjstate(true);
    setgtype("fsquad");
  };
  const fs1price = async () => {
    setps1(true);
  };
  const ps1c = async () => {
    setps1(false);
  };
  const fs2price = async () => {
    setps2(true);
  };
  const ps2c = async () => {
    setps2(false);
  };
  const fsdprice = async () => {
    setpsd(true);
  };
  const psdc = async () => {
    setpsd(false);
  };
  return jstate ? (
    <div id="pmain">
      <div id="jp">
        <div id="tc">
          <h2 id="phead">TERMS AND CONDITIONS</h2>
          <button id="pc" onClick={pc}>
            X
          </button>
          <ol>
            <li>
              The room id and password will be sent to your registered mobile
              number,Before 10min of the match.
            </li>
            <li>
              The player game level must be 25 or above.If you join the match
              with below level no cash price will be provided.
            </li>
            <li>Do not team up with any players.</li>
            <li>
              The resgistered game name should be same as your real game name,if
              its being different no cash prize will be provided.
            </li>
            <li>Do not use any hacks.</li>
            <li>Do not share the room id and password.</li>
            <li>
              If you have any payment issue after the result of the match,you
              should contact on email within 24hrs because the result of the
              matches will be cleared within 24hrs.
            </li>
            <li>
              If you violate any of these terms and conditions,your account will
              be banned.
            </li>
            <li>No refund policy</li>
          </ol>
        </div>
        <div id="jb">
          <input id="ptext" type="text" placeholder="GAME NAME" ref={gname} />
          <button id="pay" onClick={pay}>
            PAY={pamount}
          </button>
          <div id="pstatus">{pstatus}</div>
        </div>
      </div>
    </div>
  ) : (
    <div className="fmain">
      {ps1 ? (
        <div className="ps">
          <h4>WINNER : 120</h4>
          <h4>RUNNER : 60</h4>
          <h4>PER KILL : 10</h4>
          <button onClick={ps1c}>CLOSE</button>
        </div>
      ) : (
        <div className="fdiv" id="fsolo">
          <div className="fimage"></div>
          <div className="fdown1">
            <h4>
              TYPE : <span>{fs1.type}</span>
            </h4>
            <h4>
              MAP : <span>{fs1.map}</span>
            </h4>
            <h4>
              DATE : <span>{fs1.date}</span>
            </h4>
            <h4>
              TIME : <span>{fs1.time}</span>
            </h4>
          </div>
          <div className="fdown2">
            <div id="fp">
              <div id="ifp" style={{ width: `${fsc1 * 2}%` }}></div>
            </div>
            <h4 id="fpn">{fsc1}/50</h4>
            <Link className="bl" onClick={fs1price}>
              PRICE
            </Link>
            {jsbn1 === false ? (
              <button className="bjoin" onClick={fsolo1}>
                JOIN
              </button>
            ) : (
              <div className="bjoined">{joined}</div>
            )}
          </div>
        </div>
      )}
      <div className="fdiv" id="fduo">
        <div className="fimage"></div>
        <div className="fdown1">
          <h4>
            TYPE : <span>{fs2.type}</span>
          </h4>
          <h4>
            MAP : <span>{fs2.map}</span>
          </h4>
          <h4>
            DATE : <span>{fs2.date}</span>
          </h4>
          <h4>
            TIME : <span>{fs2.time}</span>
          </h4>
        </div>
        <div className="fdown2">
          <div id="fp">
            <div id="ifp" style={{ width: `${fsc2 * 2}%` }}></div>
          </div>
          <h4 id="fpn">{fsc2}/50</h4>
          {jsbn2 === false ? (
            <button className="bjoin" onClick={fsolo2}>
              JOIN
            </button>
          ) : (
            <div className="bjoined">{joined}</div>
          )}
        </div>
      </div>
      <div className="fdiv" id="fsquad">
        <div className="fimage"></div>
        <div className="fdown1">
          <h4>
            TYPE : <span>{fsd.type}</span>
          </h4>
          <h4>
            MAP : <span>{fsd.map}</span>
          </h4>
          <h4>
            DATE : <span>{fsd.date}</span>
          </h4>
          <h4>
            TIME : <span>{fsd.time}</span>
          </h4>
        </div>
        <div className="fdown2">
          <div id="fp">
            <div id="ifp" style={{ width: `${fsdc * 2}%` }}></div>
          </div>
          <h4 id="fpn">{fsdc}/50</h4>
          {jsdbn === false ? (
            <button className="bjoin" onClick={fsquad}>
              JOIN
            </button>
          ) : (
            <div className="bjoined">{joined}</div>
          )}
        </div>
      </div>
    </div>
  );
}

export default FF;
